import React from 'react';
import './index.css';
const ContactDetails=(props)=>{
    const conDelete=()=>{
     props.delete(props.id);
    }
    return(<>
        <div className="detailsCon">
            <h6> {props.Ammo}</h6>
            <p> {props.Memmo}</p>
            <button onClick={conDelete}>{props.delete}</button>
        </div>
    </>)
}
export default ContactDetails;
